	(7120,0,'2015-04-28 18:58:34',141,'2015-04-28 18:58:34',141,'Less than 2.0.4','Less than 2.0.4',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'TightVNC\' and @product=\'TightVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^2.0.[0-3]|1.[4-9].[0-9][0-9]+||1.[4-9].[0-9]+</value>\r</condition>\r</rule-set>','^2.0.[0-3]|1.[4-9].[0-9][0-9]+||1.[4-9].[0-9]+',0,b'1','',4620,'VULNERABLE',NULL,NULL,7,'TightVnc Server prior to 2.0.4 is vulnerable to a privilege escalation vulnerability. It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.tightvnc-server.less-than-204.advice',b'0'),
	(7121,0,'2015-04-28 18:58:34',141,'2015-04-28 18:58:34',141,'Less than 1.4.0','Less than 1.4.0',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'TightVNC\' and @product=\'TightVNC Server\']/registry_entry/value_value\" retval=\"P\"><value> ^1.2.[6-9]|1.3.[0-9]</value>\r</condition>\r</rule-set>',' ^1.2.[6-9]|1.3.[0-9]',0,b'1','',4620,'VULNERABLE',NULL,NULL,7,'TightVNC prior to version 1.4.0 contain multiple memory corruption vulnerabilities (CVE-2009-0388) that could an attacker to execute arbituary code or launch a Denial of Service (DoS) attack.  It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.tightvnc-server.less-than-140.advice',b'0'),
	(7122,0,'2015-04-28 18:58:34',141,'2015-04-28 18:58:34',141,'Less than 1.2.6','Less than 1.2.6',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'TightVNC\' and @product=\'TightVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^1.2.5</value>\r</condition>\r</rule-set>','^1.2.5',0,b'1','',4620,'VULNERABLE',NULL,NULL,7,'TightVNC prior to version 1.2.6 is vulnerable to a authentication bypass vulnerability (CVE-2002-1336) due to repeated DES challenges which could be captured by an eavesdropper and be used to authenicate as a valid user. It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.tightvnc-server.less-than-126.advice',b'0'),
	(7123,0,'2015-04-28 18:58:34',141,'2015-04-28 18:58:34',141,'Less than 1.2.5','Less than 1.2.5',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'TightVNC\' and @product=\'TightVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^1.2.4</value>\r</condition>\r</rule-set>','^1.2.4',0,b'1','',4620,'VULNERABLE',NULL,NULL,7,'TightVNC prior to version 1.2.5 can allow a  local attacker to bypass the application\'s GUI to gain escaleted privileges (CVE-2002-0971) by manipulating the Win32 Message System. It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.tightvnc-server.less-than-125.advice',b'0'),
	(7124,0,'2015-04-28 18:58:34',141,'2015-04-28 18:58:34',141,'Less than 1.2.4','Less than 1.2.4',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'TightVNC\' and @product=\'TightVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^1.2.[0-3]</value>\r</condition>\r</rule-set>','^1.2.[0-3]',0,b'1','',4620,'VULNERABLE',NULL,NULL,7,'TightVNC prior to version 1.2.4 can disclose authenication credentials in plaintext (CVE-2002-1848). It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.tightvnc-server.less-than-124.advice',b'0'),
	(7125,0,'2015-04-28 19:03:09',141,'2015-04-28 19:03:09',141,'Less than 1.0.8.3','Less than 1.0.8.3',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'UltraVNC\' and @product=\'UltraVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^1.0.[0-8].[0-2]|1.0.[6-8]</value>\r</condition>\r</rule-set>','^1.0.[0-8].[0-2]|1.0.[6-8]',0,b'1','',4621,'VULNERABLE',NULL,NULL,7,'UltraVNC 1.0.8.2 and prior are vulnerable to a untrusted search patch vulnerability which allows a local or potentially a remote user to hijack the UltraVNC DLL for arbitrary code execution. It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.ultravnc-server.less-than-1083.advice',b'0'),
	(7126,0,'2015-04-28 19:03:09',141,'2015-04-28 19:03:09',141,'Less than 1.0.6','Less than 1.0.6',NULL,'<rule-set>\r<condition type=\"eq\" path=\"//product[@vendor=\'UltraVNC\' and @product=\'UltraVNC Server\']/registry_entry/value_value\" retval=\"P\"><value>^1.0.[2-5]</value>\r</condition>\r</rule-set>','^1.0.[2-5]',0,b'1','',4621,'VULNERABLE',NULL,NULL,7,'UltraVNC 1.0.5 and prior are vulnerable to multiple vulnerabilities including a untrusted search patch vulnerability (CVE-2010-5248) and several integer overflow vulnerabilities that allows arbitrary code execution or an attacker to perform denial of service attacks.  It is strongly recommended that the latest stable version with all of the appropriate patches be installed.','pci-common.pos.ultravnc-server.less-than-106.advice',b'0'),
